<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>3</title>

    <style>
        :root {
            font-size: 0.3125vw; /* 1px on iPhone 5 320x568 */
        }
        * {
            padding: 0;
            margin: 0;
            box-sizing: border-box;
        }
        html, body {
            height: 100%;
        }
        body {
            font-family: "Open Sans", sans-serif;
            -webkit-text-size-adjust: 100%;
            background-color: #000000;
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            overflow: hidden;
        }
        span {
            line-height: 1.25;
        }
        img {
            width: 100%;
            height: 100%;
        }
        a {
            color: inherit;
            text-decoration: none;
        }
        .wrapper {
            display: flex;
            flex-direction: column;
            justify-content: space-between;
        }
        .container {
            margin: 0 auto;
            max-width: 640px;
            /*border: 1px solid red;*/
        }
        .header .container {
            position: relative;
        }
        .info .container,
        .footer .container {
            width: 72%;
            max-width: 460px;
        }
        .footer .container {
        }
        .header .box {
            display: flex;
            align-items: center;
            padding-top: 10rem;
            padding-left: 40rem;
            padding-right: 7%;
        }
        .logo {
            max-width: 168px;
            width: 98rem;
        }
        .logo img {
            width: 100%;
            height: 100%;
        }
        .title {
            max-width: 303px;
            width: 177rem;
            /*max-height: 29px;*/
        }
        .title img {
            width: 100%;
            height: 100%;
        }
        .line {
            width: 1px;
            height: 54rem;
            /*height: 92px;*/
            background-color: #ffffff;
            margin-left: 24px;
            margin-right: 18px;
        }
        .age {
            position: absolute;
            /*width: 33px;*/
            /*height: 32px;*/
            width: 19rem;
            height: 19rem;
            right: 10px;
            top: 11px;
        }
        .age img {
            width: 100%;
            height: 100%;
        }
        .side {
            position: absolute;
            /*height: 100vh;*/
            width: 20rem;
            left: 30px;
            top: 0;
        }
        .side-straight {
            position: absolute;
            /*height: 100vh;*/
            /*width: 5rem;*/
            height: 100vh;
            width: 6rem;
            left: 30px;
            background-color: #ff4f12;
        }
        .side img {
            height: 100%;
            width: 100%;
        }
        /*.banner {*/
        /*    width: 100%;*/
        /*    margin: 0 auto;*/
        /*}*/
        .banner {
             position: relative;
             height: 50vh;
            width: 100%;
            margin: 0 auto;
        }

        /*.banner img {*/
        /*    width: 100%;*/
        /*    height: 100%;*/
        /*}*/
        .banner img {
            width: 100%;
            /* height: 100%; */
            position: absolute;
            z-index: -1;
            height: auto;
        }
        .offer {
            display: inline-flex;
            /* display: flex; */
            align-items: center;
            justify-content: center;
            /* width: 165px; */
            /* width: 96rem; */
            /* height: 36px; */
            padding: 4rem 6rem;
            border-radius: 5px;
            background-color: #ff4f12;
            /*margin-bottom: 20px;*/
            margin-bottom: 12rem;
        }
        .offer span {
            color: #ffffff;
            font-size: 10.5rem;
            font-weight: bold;
            text-align: left;
        }

        .description {
            text-align: left;
            margin-bottom: 12rem;
        }
        .description span {
            /*font-size: 22px;*/
            font-size: 11rem;
            color: rgb(255, 255, 255);
        }

        .button {
            display: flex;
            align-items: center;
            justify-content: center;
            border-radius: 10px;
            background-color: rgb(119, 53, 255);
            text-decoration: none;
            padding: 5rem 0;
            margin-left: auto;
            margin-right: auto;
            margin-bottom: 12rem;
            max-width: 460px;
            width: 280rem;
        }
        .button span {
            font-size: 27rem;
            color: #ffffff;
            font-weight: bold;
            text-transform: uppercase;
            /*margin-right: 12rem;*/
        }
        .button .play {
            width: 38rem;
            height: 38rem;
        }
        .price {
        }
        .price span {
            font-size: 10rem;
            color: rgb(128, 128, 128);
            text-align: left;
            width: 348px;
        }
        .footer {
            margin-top: 13rem;
            margin-bottom: 10rem;
        }
        .footer p {
            font-size: 10.5rem;
            color: rgb(128, 128, 128);
            line-height: 1;
            text-align: left;
            width: 115%;
        }

        @media (max-width: 460px) {
            .button {
                max-width: 100%;
            }
        }
